// src/components/Home/Home.jsx
import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination, Scrollbar, A11y } from 'swiper/modules';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

// Import your CSS file for Home component
import './Home.css';

const Home = () => {
    return (
        <div className="cont1">
            <p>
                <u>E<span>vent</span>Hub</u>
            </p>
            <div className="cont_in" id="home">
                <p>
                    to make moments <span>beautiful...</span>
                </p>
                <Swiper
                    // Install Swiper modules
                    modules={[Navigation, Pagination, Scrollbar, A11y]}
                    spaceBetween={50}
                    slidesPerView={3}
                    navigation
                    pagination={{ clickable: true }}
                    scrollbar={{ draggable: true }}
                    onSwiper={(swiper) => console.log(swiper)}
                    onSlideChange={() => console.log('slide change')}
                >
                    <SwiperSlide><img src={require('../../assets/images/shadi.jpg')} alt="Event 1" /></SwiperSlide>
                    <SwiperSlide><img src={require('../../assets/images/janeu.jpg')} alt="Event 2" /></SwiperSlide>
                    <SwiperSlide><img src={require('../../assets/images/e2.jpeg')} alt="Event 3" /></SwiperSlide>
                    <SwiperSlide><img src={require('../../assets/images/e3.jpeg')} alt="Event 4" /></SwiperSlide>
                    <SwiperSlide><img src={require('../../assets/images/e4.jpeg')} alt="Event 5" /></SwiperSlide>
                    <SwiperSlide><img src={require('../../assets/images/e5.jpeg')} alt="Event 6" /></SwiperSlide>
                </Swiper>
            </div>
        </div>
    );
};

export default Home;
